import React from 'react'
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

export default function Service() {
    return (
        <div>
            <div>
        <Card style={{ width: '20rem' }}>
            <Card.Title>Casual Dining</Card.Title>
          <Card.Img variant="top" src="https://restaurantindia.s3.ap-south-1.amazonaws.com/s3fs-public/content8537.jpg" />
          <Card.Body>
            
            <Card.Text>
            <h4> &nbsp;&nbsp;&nbsp;&nbsp;&nbsp; A casual dining restaurant is a full-service concept with a laid-back, comfortable, family-friendly 
              a fine dining restaurant has an upscale ambiance.
            </h4>
            </Card.Text>
            <Button variant="primary">Go somewhere</Button>
          </Card.Body>
        </Card>
        </div>
        </div>
      );
}
